import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Login from './Login';
import Solicitacoes from './Solicitacoes';
import NovaSolicitacao from './NovaSolicitacao';


function App() {
  const [solicitacoes, setSolicitacoes] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8000/api/solicitacoes/')
      .then(response => {
        setSolicitacoes(response.data);
      })
      .catch(error => {
        console.error("Erro ao buscar solicitações:", error);
      });
  }, []);

  return (
    <Router>
      <div>
        <Switch>
          <Route exact path="/" component={Login} />
          <Route path="/solicitacoes" component={Solicitacoes} />
          <Route path="/nova-solicitacao" component={NovaSolicitacao} />
          {/* Outras rotas conforme necessário */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
